(45, 2, '2022-02-26 18:49:36', '2022-02-26 10:49:36', '<p>It\'s just like the story of the grasshopper and the octopus.</p><p>While it is botanically a fruit, it is considered a vegetable for culinary purposes (as well as under U.S. customs regulations, see Nix v. Hedden), which has caused some confusion.</p><p>Strange women lying in ponds distributing swords is no basis for a system of government.</p><p>I want to know what happened to the plans they sent you.</p><p>While their products leave much to be desired, Acme delivery service is second to none;</p><p></p><p>Shut up and get to the point!</p><p>As you wish.</p><p>Why do you think that she is a witch?</p><p>I need your help, Luke.</p>', 'Lotion HDMI', '<p>While it is botanically a fruit, it is considered a vegetable for culinary purposes (as well as under U.S. customs regulations, see Nix v. Hedden), which has caused some confusion.</p>', 'publish', 'open', 'closed', '', 'lotion-hdmi', '', '', '2022-02-26 18:49:36', '2022-02-26 10:49:36', '', 0, 'http://localhost/website/corsivalab-exam/product/lotion-hdmi/', 0, 'product', '', 0),
