(47, 2, '2022-02-26 18:49:36', '2022-02-26 10:49:36', '<p>I want to know what happened to the plans they sent you.</p><p>While it is botanically a fruit, it is considered a vegetable for culinary purposes (as well as under U.S. customs regulations, see Nix v. Hedden), which has caused some confusion.</p><p>Shut up and get to the point!</p><p>Lorem Ipsum Dolor Sit Amet</p><p>It is a silly place.</p><p>The Force is with him.</p>', 'Player', '<p>I want to know what happened to the plans they sent you.</p><p>The Force is with him.</p>', 'publish', 'open', 'closed', '', 'player', '', '', '2022-02-26 18:49:36', '2022-02-26 10:49:36', '', 0, 'http://localhost/website/corsivalab-exam/product/player/', 0, 'product', '', 0),
